"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[494],{27564:(e,a,s)=>{s.r(a),s.d(a,{data:()=>o});const o=JSON.parse('{"key":"v-2ac8c931","path":"/docs/asset-management/delivery-assets.html","title":"Entrega de Activos","lang":"es-ES","frontmatter":{"title":"Entrega de Activos","category":["Documentation"],"star":9,"sticky":9,"article":false,"summary":"Entrega de Activos Ubique y seleccione en el menú de Solop ERP, la carpeta Gestón de Activos, luego seleccione la carpeta Transacciones de Activos Fijos, por último seleccione la v","head":[["meta",{"property":"og:url","content":"https://ayuda.solopapp.com/docs/asset-management/delivery-assets.html"}],["meta",{"property":"og:title","content":"Entrega de Activos"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2023-07-28T20:50:37.000Z"}],["meta",{"property":"og:locale","content":"es-ES"}],["meta",{"property":"article:modified_time","content":"2023-07-28T20:50:37.000Z"}]]},"excerpt":"","headers":[{"level":2,"title":"Entrega de Activos","slug":"entrega-de-activos","children":[]}],"git":{"createdTime":1678314887000,"updatedTime":1690577437000,"contributors":[{"name":"markinpadilla","email":"mjpc27@gmail.com","commits":3},{"name":"mgarciaQ76","email":"139590879+mgarciaQ76@users.noreply.github.com","commits":1},{"name":"yamelsenih","email":"ysenih@erpya.com","commits":1}]},"readingTime":{"minutes":1.92,"words":577},"filePathRelative":"docs/asset-management/delivery-assets.md","localizedDate":"8 de marzo de 2023"}')},71350:(e,a,s)=>{s.r(a),s.d(a,{default:()=>i});var o=s(53633);const t=[(0,o.Fv)('<h2 id="entrega-de-activos" tabindex="-1"><a class="header-anchor" href="#entrega-de-activos" aria-hidden="true">#</a> Entrega de Activos</h2><p>Ubique y seleccione en el menú de Solop ERP, la carpeta <strong>Gestón de Activos</strong>, luego seleccione la carpeta <strong>Transacciones de Activos Fijos</strong>, por último seleccione la ventana de búsqueda inteligente (Smart Browser) <strong>Entrega de Activos</strong>.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image1.png" alt="Campo"></p><p>Imagen 1. Menú de Solop ERP</p><p>Podrá visualizar la ventana de búsqueda inteligente <strong>Entrega de Activos</strong>, con diferentes campos que permiten filtrar la búsqueda en base a lo requerido por el usuario.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image2.png" alt="Campo"></p><p>Imagen 2. Ventana Entrega de Activos</p><p>Seleccione en el campo <strong>Grupo de Activos</strong>, el grupo de activos por el cual requiere filtrar la información.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image3.png" alt="Campo"></p><p>Imagen 3. Campo Grupo de Activos</p><p>Seleccione en el campo <strong>Activo</strong>, el activo por el cual requiere filtrar la información.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image4.png" alt="Campo"></p><p>Imagen 4. Campo Activo</p><p>Seleccione en el campo <strong>Socio del Negocio</strong>, el socio del negocio por el cual requiere filtrar la información.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image5.png" alt="Campo"></p><p>Imagen 5. Campo Socio del Negocio</p><p>Seleccione en el campo <strong>Usuario</strong>, el usuario por el cual requiere filtrar la información.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image6.png" alt="Campo"></p><p>Imagen 6. Campo Usuario</p><p>Seleccione en el campo <strong>Producto</strong>, el producto por el cual requiere filtrar la información.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image7.png" alt="Campo"></p><p>Imagen 7. Campo Producto</p><p>Ingrese en el campo <strong>No. Lote</strong>, el número de lote por el cual requiere filtrar la información.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image8.png" alt="Campo"></p><p>Imagen 8. Campo No Lote</p><p>Ingrese en el campo <strong>No. de Serie</strong>, el número de serie por el cual requiere filtrar la información.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image9.png" alt="Campo"></p><p>Imagen 9. Campo No. de Serie</p><p>El check <strong>Propio</strong>, permite filtrar por los activos de la organización.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image10.png" alt="Campo"></p><p>Imagen 10. Campo Propio</p><p>El check <strong>En Posesión</strong>, permite filtrar por los activos que se encuentran en posesión de la organización.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image11.png" alt="Campo"></p><p>Imagen 11. Check En Posesión</p><p>Seleccione en el campo <strong>Comenzar Búsqueda</strong>, para filtrar la información en base a lo seleccionado en los campos indicados anteriormente.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image12.png" alt="Campo"></p><p>Imagen 12. Opción Comenzar Búsqueda</p><p>Podrá visualizar los resultados de la búsqueda de la siguiente manera.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image13.png" alt="Campo"></p><p>Imagen 13. Resultados de la Búsqueda</p><p>Seleccione el activo a entregar al socio del negocio.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image14.png" alt="Campo"></p><p>Imagen 14. Selección del Activo</p><p>Seleccione en el campo <strong>Socio del Negocio</strong>, el socio del negocio al cual se le esta realizando la entrega del activo.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image15.png" alt="Campo"></p><p>Imagen 15. Campo Socio del Negocio</p><p>Seleccione en el campo **Fecha del Movimiento la fecha en la cual se encuentra realizando la entrega.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image16.png" alt="Campo"></p><p>Imagen 16. Campo Entrega de Activo</p><p>Ingrese en el campo <strong>Descripción</strong>, una breve descripción de la entrega que se encuentra realizando.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image17.png" alt="Campo"></p><p>Imagen 17. Campo Descripción</p><p>Seleccione la opción <strong>OK</strong>, para ejecutar el proceso.</p><p><img src="/assets/img/docs/asset-management/asm-asset-image18.png" alt="Campo"></p><p>Imagen 18. Opción OK</p>',55)],n={},i=(0,s(26757).A)(n,[["render",function(e,a){return(0,o.uX)(),(0,o.CE)("div",null,t)}]])}}]);